 I'm trying to find a way to close the previously opened Tooltip when a new one is opened.

Here is my code:

\begin{code}
import React, from 'react';
import ReactDOM from 'react-dom';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, tooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = ({ children }) => {
  const { openTooltip, closeTooltip, tooltip } = React.useContext(TooltipContext);

  const handleMouseOver = () => {
    openTooltip(children);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {tooltip && tooltip}
    </div>
  );
};

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip>Tooltip 1</Tooltip>
      <Tooltip>Tooltip 2</Tooltip>
    </TooltipProvider>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
\end{code}

The problem is that the TooltipProvider is not wrapping the entire application, it's only wrapping the part of the application where the Tooltip is used. So, when a new Tooltip is opened, the previously opened one is not closed.

I'm looking for a way to close the previously opened Tooltip when a new one is opened, without having to wrap the entire application with the TooltipProvider.

Is there a way to achieve this?

Answer:

Yes, you can achieve this by using a different approach. Instead of using a context to manage the tooltips, you can use a singleton pattern to manage the tooltips. Here's an example of how you can implement it:

\begin{code}
import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';

const tooltipManager = {
  tooltip: null,
  openTooltip: (tooltip) => {
    tooltipManager.tooltip = tooltip;
  },
  closeTooltip: () => {
    tooltipManager.tooltip = null;
  },
};

const Tooltip = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  useEffect(() => {
    const handleMouseOver = () => {
      tooltipManager.closeTooltip();
      tooltipManager.openTooltip(children);
      setTooltip(children);
    };

    const handleMouseOut = () => {
      tooltipManager.closeTooltip();
      setTooltip(null);
    };

    return () => {
      tooltipManager.closeTooltip();
    };
  }, [children]);

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {tooltip}
    </div>
  );
};

const App = () => {
  return (
    <>
      <Tooltip>Tooltip 1</Tooltip>
      <Tooltip>Tooltip 2</Tooltip>
    </>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
\`

In this example, we create a singleton object `tooltipManager` that manages the tooltips. We use the `useEffect` hook to handle the mouse events and update the `tooltipManager` accordingly. This way, we can close the previously opened tooltip when a new one is opened, without having to wrap the entire application with a context provider.
\end{code}

